e=\"color: rgb(119, 119, 119);\">Số nút: 6 (có nút riêng set DPI 200 cho game FPS)</span></p><p><span style=\"color: rgb(119, 119, 119);\">Hỗ trợ macro, tùy chỉnh được thông qua phần mềm driver riêng</span></p><p><span style=\"color: rgb(119, 119, 119);\">Kích thước: 125x65x37 mm</span></p><p><span style=\"color: rgb(119, 119, 119);\">DPI: 200/800/1000/1500 (mặc định)/2000/2500</span></p><p><span style=\"color: rgb(119, 119, 119);\">Polling Rate: 125/250/500/1000 Hz</span></p><p><span style=\"color: rgb(119, 119, 119);\">Trọng lượng: 117g (tính dây) và 80.5g (không tính dây)</span></p><p><span style=\"color: rgb(119, 119, 119);\">Kích thước: 125x65x37 mm</span></p>','','',0,'190c853b-892d-4955-83f3-6c662fd56c9b'),('2110cf7b-fb1e-4477-b071-020cdec78294','Bàn phím AKKO 3108 RF Sailor Moon Crystal (Dual-mode / AKKO CS switch)','Bàn phím AKKO 3108 RF Sailor Moon Crystal (Dual-mode / AKKO CS switch)','2023-10-13 13:09:42','2023-10-13 13:09:42','AKKO CS',2.00,'Dual-mode / AKKO CS switch',0,'',0,'2110cf7b-fb1e-4477-b071-020cdec78294_0.png,2110cf7b-fb1e-4477-b071-020cdec78294_1.png','<p><strong>AKKO 3108 RF Sailor Moon Crystal</strong>&nbsp;hứa hẹn sẽ là bàn phím cơ không dây nổi bật nhờ những ưu điểm dưới đây</p><ul><li>Kết nối dây hoặc không dây 2.4Ghz (Wireless) sử dụng pin AAA với tuổi thọ ước tính tầm 3-5 tháng</li><li>Có tính năng kết nối không dây giúp góc giải trí của bạn gọn gàng hơn</li><li>Keycap PBT Dye-Subbed, JDA profile đã quá quen thuộc với người dùng</li><li><a href=\"https://gamek.vn/tim-kiem.chn?keyword=AKKO\" target=\"_blank\" style=\"color: rgb(51, 72, 98); background-color: transparent;\">AKKO</a>&nbsp;CS switch (Sakura) kết hợp cùng foam tiêu âm PCB cho trải nghiệm gõ tối ưu và êm ái</li><li>Thiết kế theo nhân vật Sailor Moon trong bộ hoạt hình (anime) nổi tiếng “Thủy Thủ Mặt Trăng”</li><li>AKKO 3108 RF layout Fullsize phù hợp với đa số người dùng, dễ chơi keycap</li></ul><p>Model: 3108 (Fullsize, 108 keys)</p><p>Kết nối: USB Type-C to Type-A (dây có 